import React from "react";

// Dynamically load all images from the myimages folder
const imageContext = require.context("./myimages", false, /\.(png|jpe?g|svg)$/);
const images = imageContext.keys().map(imageContext);

const Gallery = () => {
	return (
		<section id="gallery">
			<div className="row">
				<div className="twelve columns collapsed">
					<h1>My Pictures</h1>
					<div id="gallery-wrapper">
						{images.map((image, index) => (
							<img key={index} src={image} alt={`My Image ${index + 1}`} />
						))}
					</div>
				</div>
			</div>
		</section>
	);
};

export default Gallery;
